import React from 'react';

const UsersView = ({ availableUsers } ) => (
  <>
    {availableUsers && availableUsers.map(user => {
      <div>
        <p>{user.name}</p>
        <img src={user.image} alt='user' />
        <p>{user.statusText}</p>
      </div>;
    })}
  </>
);

export default UsersView;
